        private apiservice: HotelAPIserviceService)
    {
        this.guest = new Guest('', '', '', '');
        this.guestToSearch = new Guest('', '', '', '');
        this.getAllGuests();
    }


    public submitGuest() {
        this.apiservice.addNewGuest(JSON.parse(JSON.stringify(this.guest)));
        this.guest = new Guest('', '', '', '');
    }


